import React from 'react';

const Footer = () => {
    return (
        <div className="footer">
            <div id="copyright">
                <h2>copyright????</h2>
            </div>
            <div id="contact_links">
                <a href="https://www.instagram.com/greatzayahman" target="_blank" rel="noreferrer"><img src="InstaLogo.png" alt="logo"/></a>
                <a href="https://twitter.com/greatzayahman" target="_blank" rel="noreferrer"><img src="TwitterLogo.png" alt="logo"/></a>
                <a href="mailto:thvrston@gmail.com" target="_blank" rel="noreferrer"><img src="EmailLogo.png" alt="logo"/></a>
            </div>
        </div>
    );
};

export default Footer;
